function() {

  var iframes = document.getElementsByTagName('iframe');
  var embeds = document.getElementsByTagName('embed');
  var i;

  function isVimeoVideo(potentialVimeoVideo) {

    var potentialVimeoVideoSrc = potentialVimeoVideo.src || '';

    if( potentialVimeoVideoSrc.indexOf( 'player.vimeo.com/video/' ) > -1 ) {

      return true;

    }

  }

  for(i = iframes.length - 1; i > -1; i--) {

    var _iframe = iframes[i];
    var test = isVimeoVideo(_iframe);

    if(test) {
      return true;
    }

  }

  for(i = embeds.length - 1; i > -1; i--) {

    var _embed = embeds[i];
    var test = isVimeoVideo(_embed);

    if(test) {
      return true;
    }

  }

  return false;

}

